INSERT INTO `forum` (`posztID`, `userID`, `title`, `post`, `hashtag`, `postDATE`) VALUES
(93, 3, 'A Tesla Cybertruck nem kísérlet', 'Igencsak szokatlan és megosztó dizájnnal jelent meg a piacon a Cybertruck (ami sok kérdést és problémát okoz a gyártónak', NULL, '2024-01-03 07:59:06'),
(94, 3, 'Nagyon retteg a kínai chipimporttól az USA', 'Az USA kereskedelmi minisztériuma vizsgálatot kezd az amerikai félvezetőipar beszállítólánca és a nemzeti védelmi ipar k', NULL, '2024-01-03 07:59:27'),
(95, 3, 'Vodafone-részvényekre cserélte Yettel-CETIN részesedését a 4iG csoport', 'Az Antenna Hungária Zrt. részvénycsere útján megszerezte a Corvinus Nemzetközi Befektetési Zrt.-től a Vodafone Magyarors', NULL, '2024-01-03 08:00:00'),
(98, 3, 'Google Térkép költözik a Porsche autóiba', 'A Porsche már januárban jelezte, hogy fontolgatja a Google szoftverek teljes körű integrációját a jövőbeli autóiba, miután vége az együttműködésnek a Volkswagen Cariad részlegével szoftveres kutatások és fejlesztések terén.\n\nMost döntöttek: a Google Térképet, a Google Asszisztenst és egyéb Google Play-appokat is integrálják a jövőbeli járműveikbe.\n\nA Google technológiáját a General Motors, a Renault, a Nissan és a Ford is használja a járműveiben a Google Automotive Servicesen keresztül.', NULL, '2024-01-11 09:43:27'),
(115, 2, 'Kemény választ kap az Apple az EU-tól, ha nem elég engedékeny.', 'Amint arról beszámoltunk, a DMA rengeteg tech cég, így az Apple működésébe is hatalmas változásokat hoz az EU-ban. Ide kattintva olvasható el, hogy mi lesz az App Store megnyitásával, az alternatív alkalmazásboltokkal, fizetési megoldásokkal és díjakkal.', NULL, '2024-01-30 07:29:33'),
(116, 2, 'A GM és a Honda is tesz egy próbát az üzemanyagcellás autókkal', 'A General Motors és a Honda már szállítják az ügyfeleknek a Detroit melletti gyárukban készülő üzemanyagcellás megoldásokat, ugyanis le akarják tesztelni, hogy a hidrogénhajtású autókkal és technológiával elérhetnek-e átütő sikert a piacon.', NULL, '2024-01-30 07:33:13'),
(117, 2, 'A Meta megígérte: megvédi a fiatalokat a kéretlen üzenetektől az Instagramon', 'Az utóbbi hónapokban elképesztő mértékűre dagadt a Meta Facebook és Instagram platformokhoz köthető gyermekbotránya, egyértelművé vált, hogy mennyire károsak ezek a hálózatok a fiatalok mentális egészségére és fejlődésére, ahogyan az is, hogy a hasonló cégek mindent megtesznek, hogy az oldalaikra ragasszák őket, márkahű reklámnézővé és mondhatni függővé tegyék őket, miközben a közismert problémákra nem reagálnak.', NULL, '2024-01-30 07:33:45');

