(129, 3, 'DEEPCOOL CH560 Digital fekete', 'E-ATX formátumú torony kialakítású számítógépház 4 db beépített ARGB ventilátorral és beépített digitális kijelzővel.\r\n\r\n- Beépített digitális kijelző\r\n- Elegánst letisztult formavilág\r\n- Hálós front panel design\r\n- Edzett üveg oldalpanel\r\n- 4 db beépített ARGB ventilátor (3 db 140mm első és 1 db 120mm hátsó)\r\n- Folyadékhűtéses rendszerek támogatása\r\n- Kézreálló I/O portok\r\n- 7 db bővítőhely', 49000, '2024-01-30 07:29:26'),
