(131, 3, 'LOGITECH M100 Optikai vezetékes egér USB - fehér', 'Igényes alapmegoldások\r\nÜzembe helyezése gyors és egyszerű. Csupán egy USB-porthoz kell csatlakoztatnia a kábelt, és már használhatja is a terméket.\r\n\r\nKényelmes forma\r\nLegyen jobb- vagy balkezes, többórás használat után is kényelmesnek fogja találni a teljes méretű, mindkét kézbe illő egeret.\r\n\r\nNincs téves mozdulat\r\nA pontos optikai vezérléssel lehetetlen hibázni. Egéralátéttel vagy anélkül is egyenletes mozgáskövetést nyújt.', 12000, '2024-01-30 07:30:36'),
