(133, 3, 'ASUS TUF GAMING B650-PLUS', 'ASUS TUF GAMING B650-PLUS típusú alaplap Socket-AM5 foglalattal, AMD B650 chipsettel, Processzorban integrált videokártyával, 4 darab DDR5 memóriafoglalattal (max 128GB). 8 darab USB 2.0 port, 3 darab USB 3.0 port, 3 darab USB 3.1 port.', 85000, '2024-01-30 07:32:19'),
(134, 3, 'AMD Ryzen 5 5600X 3.70GHz AM4 BOX Wraith Stealth hűtő ventilátorral 100-100000065BOX', 'AMD Ryzen 5 5600X 3.70GHz AM4 dobozos processzor Wraith Stealth hűtő ventilátorral.\r\n\r\n- Alap proci sebesség: 3.7 GHz\r\n- Max turbó proci sebesség: 4.6 GHz\r\n- L2 cache: 3 MB\r\n- L3 cache: 32 MB\r\n- TDP: 65 watt\r\n- Memória típus: DDR4\r\n- Memória csatorna: 2\r\n- Max. memória sebesség: 3200 MHz', 60000, '2024-01-30 07:33:03'),
(135, 3, 'GIGABYTE G5 MF-E2HU313SD-HU magyar billentyűzet Fekete', 'GIGABYTE notebook Intel Core i5-12500H processzorral, 16GB DDR4 memóriával, 15.6”-es kijelzővel, 512GB SSD meghajtóval, NVIDIA GeForce RTX 4050 integrált videokártyával.', 360000, '2024-01-30 07:33:59'),
